import './App.css';
import "bootstrap/dist/css/bootstrap.css";
import NavBar from "./Components/NavBar";
import Tabs from "./Components/Tabs";
// import Header from "./Components/Header";
import 'bootstrap/dist/css/bootstrap.min.css';
import About from "./Components/About";
import Services from "./Components/Services";
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';

function App() {
  return (
    <>

      <NavBar/>
      <Tabs/>

      <BrowserRouter>
   <div className="Links">
     <ul style={{color:"red",listStyleType:"none"}}>
       <li style={{padding:2}}>
         <Link exact active ClassName="active_class" to="/Services" style={{color:"red",fontSize:"20px",marginTop:"30px"}}>javascript</Link>
       </li>
       <li style={{padding:2}}>
         <Link exact active ClassName="active_class" to="/About" style={{color:"red"}}>reactjs</Link>
       </li>
     </ul>
   </div>
   <Switch>
      <Route path="/About">
        <About/>
      </Route>
      <Route path="/Services">
        <Services/>
      </Route>
    </Switch>
   </BrowserRouter>


    </>
  );
}

export default App;
